import React, { useEffect, useState } from 'react'
import { Stack, Box, Button, TextField, Typography } from '@mui/material'


const SearchExercices = () => {
    return (
        <Stack width='100%' alignItems='center' mt={30} justifyContent='center'>
            <Typography
                fontWeight={900}
                sx={{ fontSize: { lg: '48px', sm: '32px', xs: '24px' } }}
                color='#131429' textAlign='center'>Effective Exercices You <br /> Should Explore</Typography>
            <Box position="relative" mb="72px">

                <TextField
                   width='100%'
                    sx={{
                        label: {
                            color: '#131429',
                            fontSize: {lg :'24px' , sm : '16px' },
                        },
                        input: {
                            fontWeight: '700',
                            fontSize: "24px",
                            color: '#131429',

                        },
                    }}
                    variant="filled" label='Search Exercices...'
                    height='70px'
                    type='text'
                />
                <Button className="search-btn" sx={{ bgcolor: '#131429', color: '#fff', textTransform: 'none', width: { lg: '173px', xs: '80px' }, height: '100%', position: 'absolute', right: '0px', fontSize: { lg: '28px', xs: '20px' } }}>
                    Search
                </Button>
            </Box>
        </Stack>
    )
}

export default SearchExercices
